import React, { useContext, useEffect, useState } from 'react';
import './PlaceOrder.css';
import { StoreContext } from '../../context/StoreContext';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const PlaceOrder = () => {
    const { getTotalCartAmount, token, food_list, cartItems, url, userId } = useContext(StoreContext);

    const [data, setData] = useState ({
        firstName: "",
        lastName: "",
        email: "",
        street: "",
        city: "",
        state: "",
        zipcode: "",
        country: "",
        phone: "",
        paymentMethod: "paystack",
        receipt: null
    });

    const onChangeHandler = (event) => {
        const name = event.target.name;
        const value = event.target.value;
        setData(data => ({ ...data, [name]: value }));
    };

    const onFileChangeHandler = (event) => {
        setData(data => ({ ...data, receipt: event.target.files[0] }));
    };

    const placeOrder = async (event) => {
        event.preventDefault();
        let orderItems = [];
        food_list.map((item) => {
            if (cartItems[item._id] > 0) {
                let itemInfo = item;
                itemInfo["quantity"] = cartItems[item._id];
                orderItems.push(itemInfo);
            }
        });

        let orderData = {
            userId: userId,
            address: data,
            items: orderItems,
            amount: getTotalCartAmount() + 2,
            paymentMethod: data.paymentMethod
        };

        if (data.paymentMethod === "paystack") {
            let response = await axios.post(url + "/api/order/place", orderData, { headers: { token } });
            if (response.data.success) {
                const { session_url } = response.data;
                window.location.replace(session_url);
            } else {
                alert("Error with Paystack");
            }
        } else if (data.paymentMethod === "bankTransfer") {
            const formData = new FormData();
            formData.append('receipt', data.receipt);
            formData.append('orderData', JSON.stringify(orderData));

            let response = await axios.post(url + "/api/order/bank-transfer", formData, { headers: { token } });
            if (response.data.success) {
                alert("Your payment is under review.");
                navigate("/myorders");
            } else {
                alert("Error with bank transfer");
            }
        }
    };

    const navigate = useNavigate();

    useEffect(() => {
        if (!token || getTotalCartAmount() === 0) {
            navigate('/cart');
        }
    }, [token]);

    return (
        <form onSubmit={placeOrder} className='place-order'>
            <div className='place-order-left'>
                <p className='title'>Delivery Information</p>
                <div className='multi-field'>
                    <input required name='firstName' onChange={onChangeHandler} value={data.firstName} type='text' placeholder='First Name' />
                    <input required name='lastName' onChange={onChangeHandler} value={data.lastName} type='text' placeholder='Last Name' />
                </div>
                <input required name='email' onChange={onChangeHandler} value={data.email} type='email' placeholder='Email Address' />
                <input required name='street' onChange={onChangeHandler} value={data.street} type='text' placeholder='Street' />
                <div className='multi-field'>
                    <input required name='city' onChange={onChangeHandler} value={data.city} type='text' placeholder='City' />
                    <input required name='state' onChange={onChangeHandler} value={data.state} type='text' placeholder='State' />
                </div>
                <div className='multi-field'>
                    <input required name='zipcode' onChange={onChangeHandler} value={data.zipcode} type='text' placeholder='Zipcode' />
                    <input required name='country' onChange={onChangeHandler} value={data.country} type='text' placeholder='Country' />
                </div>
                <input required name='phone' onChange={onChangeHandler} value={data.phone} type='text' placeholder='Phone' />

                <p>Select Payment Method:</p>
                <div>
                    <input type="radio" id="paystack" name="paymentMethod" value="paystack" checked={data.paymentMethod === "paystack"} onChange={onChangeHandler} />
                    <label htmlFor="paystack">Paystack</label>
                </div>
                <div>
                    <input type="radio" id="bankTransfer" name="paymentMethod" value="bankTransfer" checked={data.paymentMethod === "bankTransfer"} onChange={onChangeHandler} />
                    <label htmlFor="bankTransfer">Bank Transfer</label>
                </div>

                {data.paymentMethod === "bankTransfer" && (
                    <div>
                        <p>Bank Account Number: 1234567890</p>
                        <label>Upload Payment Receipt:</label>
                        <input type="file" onChange={onFileChangeHandler} required />
                    </div>
                )}
            </div>

            <div className='place-order-right'>
                <div className='cart-total'>
                    <h2>Cart Totals</h2>
                    <div>
                        <div className='cart-total-details'>
                            <p>Subtotal</p>
                            <p>${getTotalCartAmount()}</p>
                        </div>
                        <hr />
                        <div className='cart-total-details'>
                            <p>Delivery Fee</p>
                            <p>${getTotalCartAmount() === 0 ? 0 : 2}</p>
                        </div>
                        <hr />
                        <div className='cart-total-details'>
                            <b>Total</b>
                            <b>${getTotalCartAmount() === 0 ? 0 : getTotalCartAmount() + 2}</b>
                        </div>
                    </div>
                    <button type='submit'>PROCEED TO PAYMENT</button>
                </div>
            </div>
        </form>
    );
};

export default PlaceOrder;
